import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import AuthProvider from './contexts/AuthContext';
import './App.css';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <h1>Student Detection System</h1>
          <p>Testing with AuthProvider...</p>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
